import { Form } from "react-bootstrap";
import FormInputLabel from "src/Components/UI/Input/FormInputLabel";
const Store = () => {
  return (
    <>
      <Form>
        <FormInputLabel
          md={6}
          sm={12}
          label="Product Name"
          type="text"
          readOnly={false}
        />
        <FormInputLabel
          md={6}
          sm={12}
          label="Price"
          type="text"
          readOnly={false}
          placeHolder="$ 0.00"
        />
      </Form>
    </>
  );
};
export default Store;
